---A [boiler](https://wiki.factorio.com/Boiler). It heats fluid and optionally outputs it as a different fluid.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/BoilerPrototype.html)
---@class data.BoilerPrototype:data.EntityWithOwnerPrototype
---Controls for how many ticks the boiler will show the fire and fire\_glow after the energy source runs out of energy.
---
---Note that `fire` and `fire_glow` alpha is set to the light intensity of the energy source, so 0 light intensity means the fire is invisible. For burner energy sources, the light intensity will reach zero rather quickly after the boiler runs out of fuel, effectively capping the time that `fire` and `fire_glow` will be shown after the boiler runs out of fuel.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/BoilerPrototype.html#burning_cooldown)
---@field burning_cooldown uint16
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/BoilerPrototype.html#energy_consumption)
---@field energy_consumption data.Energy
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/BoilerPrototype.html#energy_source)
---@field energy_source data.EnergySource
---If this is set to false, `fire` alpha is always 1 instead of being controlled by the light intensity of the energy source.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/BoilerPrototype.html#fire_flicker_enabled)
---@field fire_flicker_enabled? boolean
---If this is set to false, `fire_glow` alpha is always 1 instead of being controlled by the light intensity of the energy source.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/BoilerPrototype.html#fire_glow_flicker_enabled)
---@field fire_glow_flicker_enabled? boolean
---The input fluid box.
---
---If `mode` is `"heat-fluid-inside"`, the fluid is heated up directly in this fluidbox.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/BoilerPrototype.html#fluid_box)
---@field fluid_box data.FluidBox
---In the `"heat-fluid-inside"` mode, fluid in the `fluid_box` is continuously heated from the input temperature up to its [FluidPrototype::max\_temperature](https://lua-api.factorio.com/latest/prototypes/FluidPrototype.html#max_temperature).
---
---In the `"output-to-separate-pipe"` mode, fluid is transferred from the `fluid_box` to the `output_fluid_box` when enough energy is available to [heat](https://lua-api.factorio.com/latest/prototypes/FluidPrototype.html#heat_capacity) the input fluid to the `target_temperature`. Setting a filter on the `output_fluid_box` means that instead of the heated input fluid getting moved to the output, it is converted to the filtered fluid in a 1:1 ratio.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/BoilerPrototype.html#mode)
---@field mode? ("heat-fluid-inside")|("output-to-separate-pipe")
