---Used for custom keyboard shortcuts/key bindings in mods. The key associated with the custom input can be changed in the options. This means that `key_sequence` is simply the default key binding.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/CustomInputPrototype.html)
---@class data.CustomInputPrototype:data.Prototype
---A [Lua event](https://lua-api.factorio.com/latest/events.html#CustomInputEvent) is only raised if the action is "lua".
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/CustomInputPrototype.html#action)
---@field action? ("lua")|("spawn-item")|("toggle-personal-roboport")|("toggle-personal-logistic-requests")|("toggle-equipment-movement-bonus")
---The alternative key binding for this control. See `key_sequence` for the format.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/CustomInputPrototype.html#alternative_key_sequence)
---@field alternative_key_sequence? string
---If `true`, when the shortcut is activated, the modifiers used for this shortcut can't be re-used to press something else until unpressed. The example where this is useful is ALT+A to activate spidertron remote, where ALT is consumed, so pressing right mouse button before the ALT is unpressed will not trigger pin creation (ALT + right mouse button), but send the selected unit instead.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/CustomInputPrototype.html#block_modifiers)
---@field block_modifiers? boolean
---Sets whether internal game events associated with the same key sequence should be fired or blocked. If they are fired ("none"), then the custom input event will happen before the internal game event.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/CustomInputPrototype.html#consuming)
---@field consuming? data.ConsumingType
---The alternative controller (game pad) keybinding for this control. See `controller_key_sequence` for the format.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/CustomInputPrototype.html#controller_alternative_key_sequence)
---@field controller_alternative_key_sequence? string
---The controller (game pad) keybinding for this control. Use "" (empty string) for unassigned.
---
---" + " is used to separate modifier buttons from normal buttons: <code>"controller-righttrigger + controller-a"</code>.
---
---For modifier buttons, the following names are used: "controller-righttrigger", "controller-lefttrigger".
---
---A key binding can contain an unlimited amount of modifier buttons (listed above) but only one normal button (listed below).
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/CustomInputPrototype.html#controller_key_sequence)
---@field controller_key_sequence? string
---If this custom input is enabled. Disabled custom inputs exist but are not used by the game. If disabled, no event is raised when the input is used.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/CustomInputPrototype.html#enabled)
---@field enabled? boolean
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/CustomInputPrototype.html#enabled_while_in_cutscene)
---@field enabled_while_in_cutscene? boolean
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/CustomInputPrototype.html#enabled_while_spectating)
---@field enabled_while_spectating? boolean
---If true, the type and name of the currently selected prototype will be provided as "selected\_prototype" in the raised [Lua event](https://lua-api.factorio.com/latest/events.html#CustomInputEvent). [This also works in GUIs](https://forums.factorio.com/96125), not just the game world.
---
---This will also return an item in the cursor such as copper-wire or rail-planner, if nothing is beneath the cursor.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/CustomInputPrototype.html#include_selected_prototype)
---@field include_selected_prototype? boolean
---The item will be created when this input is pressed and action is set to "spawn-item". The item must have the [spawnable](https://lua-api.factorio.com/latest/types/ItemPrototypeFlags.html#spawnable) flag set.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/CustomInputPrototype.html#item_to_spawn)
---@field item_to_spawn? data.ItemID
---The default key sequence for this custom input. Use "" (empty string) for unassigned.
---
---Use "mouse-button-2" etc for mouse buttons, mouse-button-3 for middle mouse button. Use "mouse-wheel-up", "mouse-wheel-down", "mouse-wheel-left", "mouse-wheel-right" for mouse wheel.
---
---" + " is used to separate modifier keys from normal keys: <code>"ALT + G"</code>.
---
---For modifier keys, the following names are used: "CONTROL", "SHIFT", "ALT", "COMMAND".
---
---A key binding can contain an unlimited amount of modifier keys (listed above) but only one normal key (listed below).
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/CustomInputPrototype.html#key_sequence)
---@field key_sequence string
---When a custom-input is linked to a game control it won't show up in the control-settings GUI and will fire when the linked control is pressed.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/CustomInputPrototype.html#linked_game_control)
---@field linked_game_control? data.LinkedGameControl
---Unique textual identification of the prototype. May only contain alphanumeric characters, dashes and underscores. May not exceed a length of 200 characters.
---
---For a list of all names used in vanilla, see [data.raw](https://wiki.factorio.com/Data.raw).
---
---It is also the name for the event that is raised when they key (combination) is pressed and action is `"lua"`, see [Tutorial:Script interfaces](https://wiki.factorio.com/Tutorial:Script_interfaces#Custom_input).
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/CustomInputPrototype.html#name)
---@field name string
local data_CustomInputPrototype={
}
end

