---An entity that produces power from fluids, for example a [steam engine](https://wiki.factorio.com/Steam_engine).
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/GeneratorPrototype.html)
---@class data.GeneratorPrototype:data.EntityWithOwnerPrototype
---If set to true, the available power output is based on the [FluidPrototype::fuel\_value](https://lua-api.factorio.com/latest/prototypes/FluidPrototype.html#fuel_value). Otherwise, the available power output will be based on the fluid temperature.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/GeneratorPrototype.html#burns_fluid)
---@field burns_fluid? boolean
---This property is used when `burns_fluid` is true and the fluid has a [fuel\_value](https://lua-api.factorio.com/latest/prototypes/FluidPrototype.html#fuel_value) of 0.
---
---This property is also used when `burns_fluid` is false and the fluid is at default temperature.
---
---In these cases, this property determines whether the fluid should be destroyed, meaning that the fluid is consumed at the rate of `fluid_usage_per_tick`, without producing any power.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/GeneratorPrototype.html#destroy_non_fuel_fluid)
---@field destroy_non_fuel_fluid? boolean
---How much energy the generator produces compared to how much energy it consumes. For example, an effectivity of 0.5 means that half of the consumed energy is output as power.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/GeneratorPrototype.html#effectivity)
---@field effectivity? double
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/GeneratorPrototype.html#energy_source)
---@field energy_source data.ElectricEnergySource
---This must have a filter if `max_power_output` is not defined.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/GeneratorPrototype.html#fluid_box)
---@field fluid_box data.FluidBox
---The number of fluid units the generator uses per tick.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/GeneratorPrototype.html#fluid_usage_per_tick)
---@field fluid_usage_per_tick data.FluidAmount
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/GeneratorPrototype.html#horizontal_animation)
---@field horizontal_animation? data.Animation
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/GeneratorPrototype.html#horizontal_frozen_patch)
---@field horizontal_frozen_patch? data.Sprite
---The power production of the generator is capped to this value. This is also the value that is shown as the maximum power output in the tooltip of the generator.
---
---`fluid_box` must have a filter if this is not defined.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/GeneratorPrototype.html#max_power_output)
---@field max_power_output? data.Energy
---The maximum temperature to which the efficiency can increase. At this temperature the generator will run at 100% efficiency. Note: Higher temperature fluid can still be consumed.
---
---Used to calculate the `max_power_output` if it is not defined and `burns_fluid` is false. Then, the max power output is `(min(fluid_max_temp, maximum_temperature) - fluid_default_temp)  fluid_usage_per_tick  fluid_heat_capacity  effectivity`, the fluid is the filter specified on the `fluid_box`.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/GeneratorPrototype.html#maximum_temperature)
---@field maximum_temperature float
---Affects animation speed.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/GeneratorPrototype.html#perceived_performance)
---@field perceived_performance? data.PerceivedPerformance
---Scales the generator's fluid usage to its maximum power output.
---
---Setting this to true prevents the generator from overconsuming fluid, for example when higher than`maximum_temperature` fluid is fed to the generator.
---
---If scale\_fluid\_usage is false, the generator consumes the full `fluid_usage_per_tick` and any of the extra energy in the fluid (in the form of higher temperature) is wasted. The [steam engine](https://wiki.factorio.com/Steam_engine) exhibits this behavior when fed steam from [heat exchangers](https://wiki.factorio.com/Heat_exchanger).
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/GeneratorPrototype.html#scale_fluid_usage)
---@field scale_fluid_usage? boolean
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/GeneratorPrototype.html#smoke)
---@field smoke? (data.SmokeSource)[]
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/GeneratorPrototype.html#vertical_animation)
---@field vertical_animation? data.Animation
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/GeneratorPrototype.html#vertical_frozen_patch)
---@field vertical_frozen_patch? data.Sprite
