---The speed of the belt: `speed  480 = x Items/second`.
---
---The raw value is expressed as the number of tiles traveled by each item on the belt per tick, relative to the belt's maximum density - e.g. `x items/second  (4 items/lane  2 lanes/belt  60 ticks/second) = <speed> belts/tick` where a "belt" is the size of one tile. See [Transport\_belts/Physics](https://wiki.factorio.com/Transport_belts/Physics) for more details.
---
---Must be a positive non-infinite number. The number is a fixed point number with 8 bits reserved for decimal precision, meaning the smallest value step is `1/2^8 = 0.00390625`. In the simple case of a non-curved belt, the rate is multiples of `1.875` items/s, even though the entity tooltip may show a different rate.
---
---[View Documentation](https://lua-api.factorio.com/latest/prototypes/TransportBeltConnectablePrototype.html#speed)
---@field speed double
